import React from "react";
import {useState, useEffect} from "react";
import getCommonOptions from "./getCommonOptions";
function Checkout(){
    let [branches, setBranches]=useState([]);
    const fetchData=()=>{
           
        fetch('http://127.0.0.1:8000/franchise/', getCommonOptions()).then(response=>response.json())
        .then((data)=>{
            const authID=data;
            setBranches(authID);

            
        }).catch((err)=>{
            console.log(err);
        })
           
        

    }
    useEffect(()=>{
        fetchData();
    },[])

    return(
        <div className="checkoutContainer">
           <div id="checkoutRow1">
               <h1>Checkout</h1>
           </div>

        </div>
    )
}
export default Checkout;
